--
-- Create procedure [Persona].[UDP_Personas_tbSolicitudes_Solicitar]
--
GO
PRINT (N'Create procedure [Persona].[UDP_Personas_tbSolicitudes_Solicitar]')
GO
/*
  CREATE TABLE persona.tbSolicitudes(
  sol_Id INT PRIMARY KEY,
  per_Id INT FOREIGN KEY REFERENCES Persona.tbPersonas(per_Id) NOT NULL,
  sol_SectorUsual NVARCHAR(100) NOT NULL UNIQUE,
  sol_Fecha DATETIME NOT NULL,
  sol_Estado bit not NULL
  )
*/
CREATE OR ALTER     PROCEDURE Persona.UDP_Personas_tbSolicitudes_Solicitar
  @per_Id int,
  @sol_SectorUsual nvarchar(max),
  @sol_Fecha DATETIME 
  AS

  

  SET NOCOUNT ON
  SET XACT_ABORT ON
  BEGIN
    BEGIN TRY
      BEGIN TRAN


--1=insertar por que NO existe
--2= NO insertar por que aun NO pasan los 10 dias

  DECLARE @opcion INT = 0;

  IF EXISTS (SELECT p.per_Id FROM Persona.tbSolicitudes p WHERE p.per_Id = @per_Id and p.sol_Estado != 2)
    BEGIN  

    DECLARE @ultimafecha DATETIME = (SELECT TOP 1 s.sol_FechaModifica FROM Persona.tbSolicitudes s WHERE s.per_Id = @per_Id);
    DECLARE @resd INT = (SELECT DATEDIFF(day,@ultimafecha,@sol_Fecha));
    IF (@resd < 10)
      BEGIN
        SET @opcion = 1
      END
    ELSE BEGIN
        SET @opcion = 2
      END
    END
  ELSE 
    BEGIN
        SET @opcion = 2
    END


  IF (@opcion = 2)
    BEGIN
      DECLARE @sol_Id INT = (SELECT ISNULL(MAX(s.sol_Id),0)+1 FROM persona.tbSolicitudes s);
      
      INSERT INTO persona.tbSolicitudes(
      sol_Id,
      per_Id,
      sol_SectorUsual,
      sol_Fecha
      ,sol_Estado)
      VALUES(
      @sol_Id,
      @per_Id,
      @sol_SectorUsual,
      @sol_Fecha
      ,1)

    END
  







      SELECT
        CAST(p.sol_Id AS VARCHAR) AS MensajeError
      FROM persona.tbSolicitudes p
      WHERE (p.sol_Id = SCOPE_IDENTITY())
      COMMIT TRAN
    END TRY
    BEGIN CATCH
      ROLLBACK TRAN
      SELECT
        '-1 ' + ERROR_MESSAGE() AS MensajeError
    END CATCH
  END
GO

